```python
import random
import numpy as np

# Define functions to generate each feature based on the given statistics
def generate_target_thickness():
    return np.random.normal(loc=1.02, scale=np.sqrt(16.9), size=1)

def generate_pulse_width():
    return np.random.normal(loc=300, scale=np.sqrt(1030000), size=1)

def generate_energy():
    correlation = 0.250
    energy = np.random.normal(loc=13.9, scale=np.sqrt(2350), size=1)
    return energy + correlation * generate_target_thickness()

def generate_spot_size():
    return np.random.normal(loc=3.61, scale=np.sqrt(13.7), size=1)

def generate_intensity():
    correlation = 0.397
    intensity = np.random.normal(loc=5.10e20, scale=np.sqrt(3.96e41), size=1)
    return intensity + correlation * generate_energy()

def generate_power():
    correlation = 0.584
    power = generate_intensity() * generate_spot_size()
    return np.log10(power)

def generate_cutoff_energy():
    correlation = 0.672
    cutoff_energy = np.random.normal(loc=8.64, scale=np.sqrt(156), size=1)
    return cutoff_energy + correlation * generate_energy()

data = []
for _ in range(25):
    target_material = random.choice(['aluminium', 'gold', 'polypropylene', 'plastic'])
    thickness = generate_target_thickness()
    pulse_width = generate_pulse_width()
    energy = generate_energy()
    spot_size = generate_spot_size()
    intensity = generate_intensity()
    power = generate_power()
    cutoff_energy = generate_cutoff_energy()

    data.append([target_material, thickness, pulse_width, energy, spot_size, intensity, power, cutoff_energy])
```

This script generates 25 new data points with each feature following the given univariate statistics and maintaining consistency between features based on their bivariate correlations. The target_material is randomly selected from a predefined list of materials.

